import Link from 'next/link';
import { Fragment } from 'react';

const About = () => (
    <Fragment>
        <Link href="/" activeClassName='active'>Home</Link>
        <Link href="/about" activeClassName='active'>About</Link>
        <div>About page</div>
    </Fragment>
)

export default About;
